 Map\\nEstimated Price:\\n$6,000 - $8,000\\nRealized Price:\\n$7,800 prices Verified + BP??\\n\\nLAVENDER JADE CARVING. Large Chinese jade carving, lavender with green inclusions, sculpture front with gourds and pods on left side in green with purple grapes and pea pods on the right, back with carved rocks, bamboo stalk and large gourds, comes with pierce carved wooden base. No mark. Size: jade: 11 1/2''H, 8''W, 3''D. jade on base: 13''H. Condition: age appropriate wear.\\n\\nIM Chait, Jadeite fruit group 16 3/4 in.\\nest. $8, 000-10,000K\\n\\nIM Chait, September 23, 2012 | Beverly Hills, CA, USA\\n\\nMASSIVE CHINESE CARVED JADEITE GROUP\\n\\nEstimated Price:\\n$12,000 - $16,000\\nRealized Price:\\n$8,000 pricesNotVerified + 22% BP + $1600 =\\n\\nMASSIVE CHINESE CARVED JADEITE GROUP\\n\32737\32736\38613\33457\26524\31296\31319\35920\25910\25670\20214\\nMassive Chinese carved green jadeite group; depicting large sprays of millet: with melons, fungus, peapods, crickets, and birds, anchored at the base by rockery and a hollowed out basket; the stone of overall pale green with good areas of bright translucent apple green coloration; H: 24 3/4\\\"\\\"\\n\\nEstimated Price: $12,000 - $16,000\\n\\nLot 289: MASSIVE GREEN & LAVENDER JADEITE GROUP\\n\\nAuction Date: July 8, 2012\\n16 3/4 in. 1 in Fruit group IM Chait, sold for $19,520\\nMASSIVE GREEN & LAVENDER JADEITE GROUP \32737\32736\38613\20154\29289\24237\38498\25850\20214 Important and massive, Chinese lavender and apple green carved jadeite group; depicting a garden scene in front of a moon gate: with a nob [...more]\\n\\nRealized : $16,000 pricesNotVerified not incl. BP\\n\\nI.M. Chait: Beverly Hills, CA, USA\\n\\nElite decorative arts basket\""})),
