with two figures, cranes, and pine tree. 6\\\"h x 8\\\"long.\\n\\nChinese Carved Jade Statue, \\\"Men and Pine Trees\\\"\\nbrowse these categories for related items...\\nDirectory: Vintage Arts: Regional Art: Asian: Chinese: Hardstones: Pre 1980: item # 1148313\\n\\nPlease refer to our stock # 7038 when inquiring.\\n\\nClick to view additional online\\nphotographs: 1 - 2 - 3 - 4 - 5 - 6\\n\\nRichard Sindler fine art and antiques\\n833 N. Howard St.\\nBaltimore, Maryland, 21201\\nTel. 410-225-2727\\nRSindler@verizon.net\\nGuest Book\\n\\n$2,200.\\nChinese Carved Jade Statue, \\\"Men and Pine Trees\\\"\\nLarge Chinese jade carving, \\\"Men and Pine Trees\\\" with wooden stand. Primarily gray jade with orange particularly on back. 20th century carving. No mark. 9.5 inches long and 5.5 inches tall. Weighs 6 1/2 pounds.\""})),
