hree goats is 3\8221 high, 4 \188\8221 long and 1 \190\8221 in depth. It depicts three long horned goats climbing on a mountain surrounded by pine trees. This is a very popular image called \8220San Yang Kai Tai\8221. . The carving is in great condition. 3 x the size as the SP\\n\\nCarved jade foo dog CHINESE JADE CARVING OF A FOO DOG\\nbrowse these categories for related items...\\nAll Items: Antiques: Regional Art: Asian: Chinese: Hardstones: Pre 1920: item # 1172883\\n\\nPlease refer to our stock # 3483 when inquiring.\\n\\nBamboo Grove\\nAnn Arbor\\nMichigan\\n\\nhulihutu04@yahoo.com\\n$675.00\\n\\nCHINESE JADE CARVING OF A FOO DOG\\nThis jade (nephrite) carving of a reclining Foo dog is 2 \190\8221 long, 1 5/8\8221 high and 1\8221 wide. It is an early 20th century product. The carving is very simple but elegant and it is in great condition. available at Bamboo Gallery for $675. The SP is approximately 3 x the size as this property\\n\\nSHERRI GARNER ANTIQUES AND FINE ART\\n209 Fairview Court\\nGrand Island, NEW YORK 14072\\n716 773-6057\\nmzdragonwoman@aol.com\\nGuest Book\\n\\n$1700\\nJADE (LAVENDER JADEITE) FOO SCULPTURE, QING DYNASTY\\nThis is an exceptionally carved and especially pleasing late Qing Dynasty FOO DOG and PUPPY carved of fine lavender jadite. Sculpted in great detail this is a fairly large carved work. Mamma and her puppy with a brocade ball and bilowing ribbon are totally adorable. The Foos recline on a detailed carved and cut out plinth made especially for the sculpture.\\nThis very special winsome sculptural carving dates to turn of the century or earlier. If there is such a thing as personality in carving, it shows in this figural sculpture.\\nDimensions: About 8\\\" Condition; Excellent\\\"\""})), subForest = []}]}]},Node {rootLabel = Peek_ReportView_Markup (Path_ReportView__reportBody (Path_At (ReportElemID {unReportElemID = 8}) (Path_ReportElem_elemItem (Path_Item_fields (Path_Look ItemCashValue Path_Markup))))) Internal, subForest = [N