ortView__reportBody (Path_At (ReportElemID {unReportElemID = 10}) (Path_ReportElem_elemItem (Path_Item_fields (Path_Look ItemDescription (Path_Markup_markdownText (Path_Text_View Path_JSONText))))))) (Leaf (JSONText {unJSONText = "\"A pair of towering landscapes depicting the steep canyons carved out by the Yangzi River in the famous Three Gorges region. It is painted in the traditional blue and green palette associated with Tang Dynasty painting.\""})), subForest = []}]}]},Node {rootLabel = Peek_ReportView_Markup (Path_ReportView__reportBody (Path_At (ReportElemID {unReportElemID = 10}) (Path_ReportElem_elemItem (Path_Item_fields (Path_Look ItemMarketAnalysis Path_Markup))))) Internal, subForest = [Node {rootLabel = Peek_ReportView_Text (Path_ReportView__reportBody (Path_At (ReportElemID {unReportElemID = 10}) (Path_ReportElem_elemItem (Path_Item_fields (Path_Look ItemMarketAnalysis (Path_Markup_markdownText Path_Text)))))) Internal, subForest = [Node {rootLabel = Peek_ReportView_JSONText (Path_ReportView__reportBody (Path_At (ReportElemID {unReportElemID = 10}) (Path_ReportElem_elemItem (Path_Item_fields (Path_Look ItemMarketAnalysis (Path_Markup_markdownText (Path_Text_View Path_JSONText))))))) (Leaf (JSONText {unJSONText = "\"Liu Zuozhong is based in Chongqing, Sichuan Province and is known for his large-scale landscape paintings of the Three Gorges region. Although there references to his work on the internet, a search for market data for his paintings yielded no records of sale either in online databases or galleries. The description of his work is found on travelers' blogs who visiting Chongqing where the artist resides.\\n\\nSince no prices are available,  the market data of contemporary artists working in the ink and color on paper with traditional Chinese subject matter such as bird and flower paintings and landscapes was utilized. Similar size contemporary paintings of comparable quality by artists range in price from $1,200 to $4,500. Because of the unusual size and fine quality of the painting, the subject matter falls on the high end of this range of $4,500 x 2.\""})), subForest = []}]}]},Node {rootLabel = Peek_ReportView_Markup (Path_ReportView__reportBody (Path_At (ReportElemID {unReportElemID = 10}) (Path_ReportElem_elemItem (Path_Item_fields (Path_Look ItemExhibitionsAndPublications Path_Markup))))) Internal, subForest = [Node {rootLabel = Peek_ReportView_Text (Path_ReportView__reportBody (Path_At (ReportElemID {unReportElemID = 10}) (Path_ReportElem_elemItem (Path_Item_fields (Path_Look ItemExhibitionsAndPublications (Path_Markup_markdownText Path_Text)))))) Internal, subForest = [Node {rootLabel = Peek_ReportView_JSONText (Path_ReportView__reportBody (Path_At (ReportElemID {unReportElemID = 10}) (Path_ReportElem_elemItem (Path_Item_fields (Path_Look ItemExhibitionsAndPublications (Path_Markup_markdownText (Path_Text_View Path_JSONText))))))) (Leaf (JSONText {unJSONText = "\"\""})), subForest = []}]}]},Node {rootLabel = Peek_ReportView_Markup (Path_ReportView__reportBody (Path_At (ReportElemID {unReportElemID = 10}) (Path_ReportElem_elemItem (Path_Item_fields (Path_Look ItemAdditionalNotes Path_Markup))))) Internal, subForest = [Node {rootLabel = Peek_ReportView_Text (Path_ReportView__reportBody (Path_At (ReportElemID {unReportElemID = 10}) (Path_ReportElem_elemItem (Path_Item_fields (Path_Look ItemAdditionalNotes (Path_Markup_markdownText Path_Text)))))) Internal, subForest = [Node {rootLabel = Peek_ReportView_JSONText (Path_ReportView__reportBody (Path_At (ReportElemID {unReportElemID = 10}) (Path_ReportElem_elemItem (Path_Item_fields (Path_Look ItemAdditionalNotes (Path_Markup_markdownText (Path_Text_View Path_JSONText))))))) (Leaf (JSONText {unJSONText = "\"In the city of Chongqing we met artist, Liu Zuo Zhong. For twenty years he hiked the regions that were to be flooded taking thousands of photographs and doing hundreds of sketches of the people, scenery and landmarks. Mr. Zhong has worked tirelessly to create a painting as long as a football field which depicts the riverbank of the Yangtze before the flooding began\\n\\nChinese Watercolor of Cherry Blossoms\\nbrowse these categories for related items...\\nAll Items: Fine Art: Paintings: Watercolor: Contemporary: item # 1162690\\n\\nPlease refer to our stock # 1002 when inquiring.\\n\\nDynasty Collections\\n31531 Camino Capistrano\\nSan Juan Capistrano, CA 92675\\n949+240-6900\\ninfo@dynastycollections.com\\n$1,850.00\\n\\nChinese Watercolor of Cherry Blossoms\\nChinese framed water color of flowering cherry blossom branch with calligraphy at the top left side. In a black lacquer frame with red edge. Age: 20th century Size: 36 3/4\\\" x 6\8217\&1\\\" (93.3 x 185.4 cm)\\nSimilar size to SP but different subject matter\\n\\nJiang Zhixin, landscape 68 (26.5 in.) x 135 cm\\n(53.5 in.) available through Tianduart.com for $1,600.\\n\\nChen Yan Jiao, 135 cm.(53.5 in.) x 68 cm. (26.5 in.) $1,200\\n\\nAsian Works of Art on Trocadero.com\\nMaster Kueh Chai Phiaw is 75 yrs old now.  He is Malaysia's first generation & pioneer artist from Borneo Island, Sarawak, his masterly executed works especially traditional chinese brush painting and calligraphy is recognized here and overseas as he has the brush style of Puru, Huang Junbi and Zhang Daqian, as he is student of great masters in China while he study there in the late 50s in National Taiwan Normal University. He is also proficient in western watercolor, modern abstract, oil and stone carving of seal art as he study under other great master in those area of interest too. Pls find his profile attached too.\\nThe price for this local landscape /village in misty riverbank scenery using chinese ink style 47inches x 26 inches is USD4500 only, as it is local longhouse scenery(tribal village of dayak tribe people in Borneo Island) the value is there as the museum here valued his contributions to art as local pioneer and it is my personal favorite piece. Please find his profile and photos as attached here. For the other piece of landscape which has the style /wind of Master Huang Junbi, measures 36inches x 21inches, the price is USD2500 only as it is not fully mounted yet but you can frame it immediately as it is. Thank for very much.\""})), subForest = []}]}]},Node {rootLabel = Peek_ReportView_Markup (Path_ReportView__reportBody (Path_At (ReportElemID {unReportElemID = 10}) (Path_ReportElem_elemItem (Path_Item_fields (Path_Look ItemCashValue Path_Markup))))) Internal, subForest = [Node {rootLabel = Peek_ReportView_Text (Path_ReportView__reportBody (Path_At (ReportElemID {unReportElemID = 10}) (Path_ReportElem_elemItem (Path_Item_fields (Path_Look ItemCashValue (Path_Markup_markdownText Path_Text)))))) Internal, subForest = [Node {rootLabel = Peek_ReportView_JSONText (Path_ReportView__reportBody (Path_At (ReportElemID {unReportElemID = 10}) (Path_ReportElem_elemItem (Path_Item_fields (Path_Look ItemCashValue (Path_Markup_markdownText (Path_Text_View Path_JSONText))))))) (Leaf (JSONText {unJSONText = "\"$9,000\""})), subForest = []}]}]}]},Node {rootLabel = Peek_ReportView_ReportImages (Path_ReportView__reportBody (Path_At (ReportElemID {unReportElemID = 10}) (Path_ReportElem_elemItem (Path_Item_images Path_OMap)))) Internal, subForest = [Node {rootLabel = Peek_ReportView_ReportImage (Path_ReportView__reportBody (Path_At (ReportElemID {unReportElemID = 10}) (Path_ReportElem_elemItem (Path_Item_images (Path_At (ReportImageID {unReportImageID = 0}) Path_ReportImage))))) Internal, subForest = [Node {rootLabel = Peek_ReportView_ReportImageView (Path_ReportView__reportBody (Path_At (ReportElemID {unReportElemID = 10}) (Path_ReportElem_elemItem (Path_Item_images (Path_At (ReportImageID {unReportImageID = 0}) (Path_ReportImage_View Path_ReportImageView)))))) Internal, subForest = [Node {rootLabel = Peek_ReportView_SaneSizeImageSize (Path_ReportView__reportBody (Path_At (ReportElemID {unReportElemID = 10}) (Path_ReportElem_elemItem (Path_Item_images (P