ver the required services.  The\\naforementioned fees will be billed at the rate commensurate with the\\ntiming of the appraisal.\\n\\nThank you for allowing me to be of service to you.\""})), subForest = []}]}]},Node {rootLabel = Peek_ReportView_Markup (Path_ReportView__reportScopeOfWork Path_Markup) Internal, subForest = [Node {rootLabel = Peek_ReportView_Text (Path_ReportView__reportScopeOfWork (Path_Markup_markdownText Path_Text)) Internal, subForest = [Node {rootLabel = Peek_ReportView_JSONText (Path_ReportView__reportScopeOfWork (Path_Markup_markdownText (Path_Text_View Path_JSONText))) (Leaf (JSONText {unJSONText = "\"Thompson & Martinez Fine Art Appraisals, Inc. was hired by Joseph and Sandy Augustine to reach an opinion of the Replacement Value Comparable of a group of Chinese sculptures and paintings for the intended use of Insurance.  Based on discussion with the Clients about where they would shop to replace the property, as well as the intended use of the report, the type and location of the subject property and the effective date of valuation, the appraiser has selected the type of value, the relevant market, the information researched and the analysis to be applied.  The Appraiser inspected the properties on October 3rd, 2012 at the home of the client.  To complete this assignment I consulted consulted on-line sources, reviewed published and on-line market data and interviewed knowledgeable dealers and others regarding the relevant markets.\\n\\nThis report is intended to be an objective, independent, unbiased and credible analysis of known facts.  During the course of examination, research and analysis, I have endeavored to be accurate and to use due diligence.  This opinion of value was developed using appraisal methods that are within the accepted standard of care for the appraisal profession and within the boundaries of typical practice.\\n\\nThis appraisal document reports the information analyzed, the appraisal procedures followed, and the reaso